import React, {useState } from "react";
import '../App.css'
import { Card, Container,Nav,Button,Form } from "react-bootstrap";
import Header from '../components/Header';
import {useHistory} from 'react-router-dom';

export default function DoctorLogin(props){
    const history= useHistory();
    
    const handleChange=()=>{
        props.history.push('/DoctorDashboard')
    }

    fetch('http://localhost:3001/doctorlogin', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(credentials)
    })
      .then(data => data.json())
   }
   
  function Login({ setToken }) {
     const [doctor_id, setDoctor_id] = useState();
     const [password, setPassword] = useState();
   
     const handleSubmit = async e => {
       e.preventDefault();
       const token = await DoctorLogin({
         doctor_id,
         password
       });
       setToken(token);
     }
    
    return(
        <div>
             <Header />
        <Container fuild="xl">
            <Card className="myCard">
  <Card.Header>
    <Nav variant="tabs">
      <Nav.Item>
        <Nav.Link href="/AdminLogin" >Admin</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link href="/VCLogin">Vaccination Center</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link href="/VerificationLogin" >
          Verification Center
        </Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link href="/VerifierLogin">
          Verifier
        </Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link href="/DoctorLogin" active >
          Doctor
        </Nav.Link>
      </Nav.Item>
    </Nav>
  </Card.Header>
  <Card.Body>
    <Card.Title className="cardTitle">Doctor Login</Card.Title>
    <Card.Text>
    <Form onSubmit={handleSubmit}>
  <Form.Group controlId="formBasicIDl">
    <Form.Label className="formLabel">Doctor-id</Form.Label>
    <Form.Control type="text" name="doctor_id" onChange={e => setDoctor_id(e.target.value)} placeholder="Enter ID" />
    
  </Form.Group>

  <Form.Group controlId="formBasicPassword">
    <Form.Label className="formLabel">Password</Form.Label>
    <Form.Control type="password" name="password" onChange={e => setPassword(e.target.value)}  placeholder="Password" />
  </Form.Group>
  
</Form>
    </Card.Text>
    <Button onClick={handleChange} className="loginBtn" variant="primary">Login</Button>
  </Card.Body>
</Card>
        </Container>
        </div>
    )
}
